import React from "react";

function About(){
    return(
        <section id= "about">
            <h1> Hi, my name is Rayan </h1>
            <p>I'm a web developer from Ottawa</p>
            <div id= "contact">
                <a href="#contact">
                    Contact me
                </a>
                <a href="#projects">
                    My projects
                </a>
            </div>
        </section>
    )
};

export default About;
